import React, {useState, useEffect} from 'react';
import AddReview from './components/AddReview/AddReview.js';
import CurrentReview from './components/CurrentReview/CurrentReview.js';

import './App.css';

function App() {
    const [addReview, setAddReview] = useState(true);

  return (
    <div className="App">
      <h1>Course Review</h1>
      <div className="grey-card-container">{ addReview ? <CurrentReview/> : <AddReview />}</div>
      <div className="view-selection-div">
          <button className="view-button">Current Review</button>
          <button className="view-button active-button ">Add Review</button>
      </div>
    </div>
  );
}

export default App;
